import React from 'react';
import ReactDOM from 'react-dom';

class InformationSelector extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isTemperature: false,
            isDistance: false
        };
    }
    onChangeTemperature = () => {
        this.setState(initialState => ({
            isTemperature: !initialState.isTemperature,
        }));
    }
    onChangeDistance = () => {
        this.setState(initialState => ({
            isDistance: !initialState.isDistance,
        }));
    }

    onSubmit = (e) => {
        e.preventDefault();
        console.log(this.state);
    }

    render() {
        return (
         <form onSubmit={this.onSubmit}>
              <select value={this.state.country}>
                <option value="Nederland">Nederland</option>
                <option value="China">China</option>
              </select>
              <p>
                <label>
                  Temperature
                  <input
                    name="Temperature"
                    type="checkbox"
                    checked={this.state.name}
                    onChange={this.onChangeTemperature}/>
                </label>
                <label>
                  Distance
                  <input
                    name="Distance"
                    type="checkbox"
                    checked={this.state.name}
                    onChange={this.onChangeDistance}/>
                </label>
              </p>
              <button>
                Get Info
              </button>
          </form>
        );
    }
}

ReactDOM.render(<InformationSelector />, document.getElementById('selectInformationTypes'));
